INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 0, 1, 0.0, 24001, "あたしだって\nやるときはやるよ！", 0.0, "リン", 1, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 1, 1, 0.0, 24002, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, "リン", 1, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 2, 1, 0.0, 24003, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, "リン", 1, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 3, 2, 0.0, 24004, "やったね！\nこれでようやく\nサボれるよ…", 0.0, "リン", 2, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 4, 1, 0.0, 24005, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, "リン", 1, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 5, 2, 0.0, 24006, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, "リン", 2, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 6, 2, 0.0, 24007, "あたしも意外と\nやるもんでしょ？", 0.0, "リン", 2, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 7, 4, 0.0, 24008, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, "リン", 4, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 8, 4, 0.0, 24009, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, "リン", 4, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 9, 4, 0.0, 24010, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, "リン", 4, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 10, 4, 0.0, 24011, "やられた…\nねずみって意外と\nてごわいね", 0.0, "リン", 4, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0.0, 102601, 10040, 11, 4, 0.0, 24012, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, "リン", 4, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (1.81, 102601, 10040, 12, 1, 0.0, 24013, "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, "リン", 4, 24, "2030/12/17 14:59:59", "2020/04/30 12:00:00");
